import { changeDone, changeUserName, addTodo, deleteTodo, selectedTodo, selectedUserName } from "./store/slice";

export const TodoList = () => {

    const useAppDispatch = () => useDispatch<AppDispatch>();
    const useAppSelector: TypedUseSelectorHook<RootState> = useSelector;

    const todo = useAppSelector(selectedTodo)
    const userName = useAppSelector(selectedUserName)
    const dispatch = useAppDispatch();

    return (
        <div>
            <p>
               name: {selectedUserName}
            </p>
            <p>
                list: {selectedTodo}
            </p>
        </div>
    )
}
